‚†Ä
Did you know that risotto is a Northern Italy specialty always served as a first course? Making risotto requires a uniquely Northern Italian technique of frying rice and onions in butter and olive oil, and slowly adding hot broth, with the important final step to ‚Äùmantecare‚Äù (Italian for beat together) the butter and cheese during the final minutes of cooking! This hearty & creamy dish will be a new favourite!
‚†Ä
Note: If you want to make a seafood risotto, refrain from adding cheese! I cannot stress this enough, NEVER add cheese to a seafood risotto or seafood pasta dish!ü¶û+üç§+üßÄ=üõëüôÖüèª‚Äç‚ôÄÔ∏è
‚†Ä
Ingredients:
Extra virgin olive oil
2 garlic cloves, minced
1/2 lbs porcini mushrooms, chopped
1/2 cup white wine (optional)
Salt and pepper to taste
3 cups chicken broth (preferably homemade)
2 tbsp + 1 tbsp butter
1 small onion, chopped
1 cup Arborio rice (only use Arborio, Carnaroli, Vialone Nano or Maratelli rice for risotto)
Handful of fresh parsley, chopped
1/3 cup Parmesan, grated
‚†Ä
Directions:
‚†Ä
Step 1:
In a medium size frying pan, drizzle olive oil and fry garlic on medium heat for a few min until oil is fragrant.
‚†Ä
Step 2:
Add the porcini and fry for 8-10 min. Set aside.
‚†Ä
Step 3.
In a medium sauce pan, heat the chicken broth. Keep warm.
‚†Ä
Step 4:
In your Dutch oven on medium heat, melt 2 tbsp butter and about 3 tbsp olive oil. Add the onion and dry rice and stir fry for a few min. Add the white wine and stir until wine is reduced.
‚†Ä
Step 5:
With a ladle, add 1 scoop of warm chicken broth to the rice and slowly stir until absorbed.
‚†Ä
Step 6:
Keep adding broth one scoop at a time and stir until broth is absorbed. Whole process should take about 18 min.
‚†Ä
Tip: if you run out of broth during the final min of cooking and risotto is still too dry, add a bit of water üí¶
‚†Ä
Step 7:
When the rice becomes rich and creamy and is al dente, throw in the porcini, Parmesan, parsley and 1 tbsp butter, mix until it becomes a gorgeous risotto. Taste for salt and serve and enjoy at once üòâ

